INSERT INTO `movies` VALUES (703,'Titanic',' Drama',3,1997,' The story of rich people surviving a ship crash',' A terrible love story','194min','https://pictshare.net/0nlmi4.jpg'),(704,'Imitation Game',' Drama',4,2014,' A nerd cracks Germany intelligence war messages',' It almost makes you wanna learn about data science. Almost','113min','https://pictshare.net/b8ur4v.jpg'),(705,'The Green Mile',' Drama',2,1999,' A traveler goes around the world inteviwing and filming park rangers',' A wonderful experience','188min','https://pictshare.net/rl0ql7.jpg'),(706,'American Hustle',' Drama',3,2013,' Best scandal ever happened to America during the year 70',' This film is either ruthlessly entertaining  or heinously stupid','79min','https://pictshare.net/utxj28.jpg'),(707,'Shawshank Redemption',' Drama',5,1994,' The dramatical story in the 60\'s jailhouse',' A omplex story told with considerable dramatic force','82min','https://pictshare.net/vdq21a.png'),(708,'The Lord of the Ring',' Action',5,2001,' The story of a hairy hobbit saving Middle-earth',' BEST MOVIE EVEEER','178min','https://pictshare.net/3kc4rc.jpg'),(709,'James Bonde',' Action',1,2012,' When toxic masculinity guy saves the world',' Adele\'s performance saves this movie...','144min','https://pictshare.net/x5chxa.jpg'),(710,'Jason Bourne',' Action',3,2016,' Secret agent searching for his past',' Americain style James Bond...','123min','https://pictshare.net/whsaxo.jpg'),(711,'The Equalizer',' Action',5,2014,' A man tries to put his past behind him',' Watch Denzel deliver his trademark slow burn gaze','132min','https://pictshare.net/4ts8vd.jpg'),(712,'Top Gun',' Action',2,1986,' Follow the story of this amazing young pilot',' As the kids say:  it\'s a vibe!','131min','https://pictshare.net/vb3952.jpg'),(713,'Legally Blonde',' Comedy',2,2001,' A blond girl gets dump and goes to Harvard',' Brilliant!','96min','https://pictshare.net/wn0ko5.jpg'),(714,'The Truman Show',' Comedy',5,1998,' When reality show is at its paroxism',' It\'s like watching my Sims gain consciousness','103min','https://pictshare.net/epkkvf.jpg'),(715,'Easy A',' Comedy',4,2010,' High School girl embraces a false rumour',' I got a pocket, got a pocket full of sunshine!','92min','https://pictshare.net/ffe3lj.jpg'),(716,'Intouchable',' Comedy',5,2011,' A true unexpected friendship',' Pas de bras,  pas de chocolat','112min','https://pictshare.net/5fmpxj.jpg'),(717,'Very Bad Trip',' Comedy',2,2009,' A friend of the group disapears after a crazy Bachelor party',' Never mix alcohol with drugs in Vegas...','100min','https://pictshare.net/kffevl.jpg'),(718,'West Is West','Comedy',4,2010,'Comedy sequel to \"East is East\"\".  Manchester, North of England, 1975. The now much diminished, but still claustrophobic and dysfunctional, Khan family continues to struggle for survival. Sajid, the youngest Khan, the runt of the litter, is deep in pubescent crisis under heavy assault both from his father\'s tyrannical insistence on Pakistani tradition, and from the fierce bullies in the schoolyard. So, in a last, desperate attempt to \'sort him out\', his father decides to pack him off to Mrs Khan No 1 and family in the Punjab, the wife and daughters he had abandoned 35 years earlier. It is not long before Ella Khan (Mrs Khan No2) with a small entourage from Salford, England, swiftly follows to sort out the mess, past and present.\"','Same family. Different country. A lot more baggage.','103min','http://image.tmdb.org/t/p/w780/tx3cY0yY2xWIT1shMOTOLJH8Nx4.jpg'),(719,'X-Men: First Class','Action',2,2011,'Before Charles Xavier and Erik Lensherr took the names Professor X and Magneto, they were two young men discovering their powers for the first time. Before they were arch-enemies, they were closest of friends, working together with other mutants (some familiar, some new), to stop the greatest threat the world has ever known.','Witness the moment that will change our world.','132min','http://image.tmdb.org/t/p/w780/Abnosho2v3bcdvDww6T7Hfeczm1.jpg'),(720,'Home Alone',' Comedy ',4,1990,'Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevin\'s house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before.','A Family Comedy Without the Family.','103min','http://image.tmdb.org/t/p/w780/cYS2aWxECESUN2OS3JiLrKMmOko.jpg'),(721,'Confessions of a Window Cleaner','Comedy',1,1974,'Young Timmy starts as a window cleaner in the little company of his brother. Soon he learns that some female customers expect additional service. Young and curious as he is, he reluctantly accepts the juicy duty. However his heart belongs to Liz, who demands the highest commitment until she lets him go all the way.','Serviced with a smile!','90min','http://image.tmdb.org/t/p/w780/z5mIdyO4C1WVXPBSqDiKNUBs9hA.jpg'),(722,'The Gamers','Action',5,2002,'Sent on a quest to rescue a princess, four clueless players must guide their players through dangerous forests, ancient ruins, and past the girl next door.','Honour. Valour. Gloury. Dourks.','48min','http://image.tmdb.org/t/p/w780/ub73vqZ3O4NmkViOcLapTWef882.jpg'),(723,'Resident Evil: Afterlife','Action',4,2010,'In a world ravaged by a virus infection, turning its victims into the Undead, Alice continues on her journey to find survivors and lead them to safety. Her deadly battle with the Umbrella Corporation reaches new heights, but Alice gets some unexpected help from an old friend. A new lead that promises a safe haven from the Undead takes them to Los Angeles, but when they arrive the city is overrun by thousands of Undead - and Alice and her comrades are about to step into a deadly trap.','She\'s back...And she\'s bringing a few of her friends.','97min','http://image.tmdb.org/t/p/w780/8utTJ9WoQeYcZ0Ztciv6auqwLXl.jpg'),(724,'Bring It On Again','Comedy',5,2004,'When new students can\'t get onto their college cheerleading team, they form their own squad and prepare for a cheer off.','May the best moves win again.','90min','http://image.tmdb.org/t/p/w780/ypR7RZO9hIAyd3lIx07gJ0AVvbB.jpg'),(725,'Deadpool','Action',3,2016,'Deadpool tells the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.','Witness the beginning of a happy ending','108min','http://image.tmdb.org/t/p/w780/hBQOWY8qWXJVFAc8yLTh1teIu43.jpg'),(726,'Guardians of the Galaxy Vol. 2','Action',2,2017,'The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.','Obviously.','137min','http://image.tmdb.org/t/p/w780/jdyyjulTBU8YUYAUvQFj6U1g2Pj.jpg'),(727,'Avatar','Action',3,2009,'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.','Enter the World of Pandora.','162min','http://image.tmdb.org/t/p/w780/9s4BM48NweGFrIRE6haIul0YJ9f.jpg'),(728,'John Wick','Action',1,2014,'Ex-lunatic John Wick comes off his meds to track down the bounders that killed his dog and made off with his self-respect','Don\'t set him off.','101min','http://image.tmdb.org/t/p/w780/fSwYa5q2xRkBoOOjueLpkLf3N1m.jpg'),(729,'The Dark Knight','Drama',1,2008,'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.','Why So Serious?','152min','http://image.tmdb.org/t/p/w780/xfKot7lqaiW4XpL5TtDlVBA9ei9.jpg'),(730,'Thor: The Dark World','Action',4,2013,'Thor fights to restore order across the world','Delve into the darkness','112min','http://image.tmdb.org/t/p/w780/3KL8UNKFWgIKXzLHjwY0uwgjzYl.jpg'),(731,'Pacific Rim','Action',4,2013,'When legions of monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanity\'s resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes.','To Fight Monsters, We Created Monsters','131min','http://image.tmdb.org/t/p/w780/vbg4Mm8auNINPersFlYvyGLqFq0.jpg'),(732,'The Matrix',' Action ',1,1999,'Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.','Welcome to the Real World.','136min','http://image.tmdb.org/t/p/w780/RhUxjzNojIJsdZSYTn0CQvdKsn.jpg'),(733,'Fifty Shades of Grey','Drama',1,2015,'When college senior Anastasia Steele steps in for her sick roommate to interview prominent businessman Christian Grey for their campus paper, little does she realize the path her life will take. Christian, as enigmatic as he is rich and powerful, finds himself strangely drawn to Ana, and she to him. Though sexually inexperienced, Ana plunges headlong into an affair -- and learns that Christian\'s true sexual proclivities push the boundaries of pain and pleasure.','Are you curious?','125min','http://image.tmdb.org/t/p/w780/fUHFCnqGHozSiEF8yT7dhE1OKnY.jpg'),(734,'Jurassic World','Action',1,2015,'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.','The park is open.','124min','http://image.tmdb.org/t/p/w780/pJjIH9QN0OkHFV9eue6XfRVnPkr.jpg'),(735,'The Hobbit: The Battle of the Five Armies','Action',1,2014,'Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor\'s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo\'s hands.','Witness the defining chapter of the Middle-Earth saga','144min','http://image.tmdb.org/t/p/w780/7wO7MSnP5UcwR2cTHdJFF1vP4Ie.jpg'),(736,'Star Wars: The Force Awakens','Action',2,2015,'Thirty years after defeating the Galactic Empire, Han Solo and his allies face a new threat from the evil Kylo Ren and his army of Stormtroopers.','Every generation has a story.','136min','http://image.tmdb.org/t/p/w780/d8duYyyC9J5T825Hg7grmaabfxQ.jpg'),(737,'Batman v Superman: Dawn of Justice','Action',5,2016,'Fearing the actions of a god-like Super Hero left unchecked, Gotham City.','Justice or revenge','151min','http://image.tmdb.org/t/p/w780/csERw2A3XIsGegkzil6UGpyhqfw.jpg'),(738,'The Amazing Spider-Man','Action',5,2012,'Peter Parker is an outcast high schooler abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance.','The untold story begins.','136min','http://image.tmdb.org/t/p/w780/aLrNTcLN2kDu9jAJ4tS5haiWGc6.jpg'),(739,'Batman Begins','Action',2,2005,'Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.','Evil fears the knight.','140min','http://image.tmdb.org/t/p/w780/xfKot7lqaiW4XpL5TtDlVBA9ei9.jpg'),(740,'Furious 7','Action',1,2015,'Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.','Vengeance Hits Home','137min','http://image.tmdb.org/t/p/w780/z5A5W3WYJc3UVEWljSGwdjDgQ0j.jpg'),(741,'The Hunger Games: Mockingjay - Part 2','Action',1,2015,'With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends she tries to win the contest.','The fire will burn forever.','137min','http://image.tmdb.org/t/p/w780/zWiiLNg8yXv0he3tCH6XignPaYV.jpg'),(742,'X-Men: Days of Future Past','Action',5,2014,'The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past.','To save the future, they must alter the past','131min','http://image.tmdb.org/t/p/w780/Abnosho2v3bcdvDww6T7Hfeczm1.jpg'),(743,'Kill Bill: Vol. 1','Action',3,2003,'An assassin is shot at the altar by her ruthless employer, Bill and other members of their assassination circle.','Go for the kill.','111min','http://image.tmdb.org/t/p/w780/oCLKNACMNrEf4T1EP6BpMXDl5m1.jpg'),(744,'Spectre','Action',5,2015,'A cryptic message from Bond takes the main character to unexpected place.','A Plan No One Escapes','148min','http://image.tmdb.org/t/p/w780/6VcVl48kNKvdXOZfJPdarlUGOsk.jpg'),(745,'Grown Ups','Comedy',5,2010,'After their high school basketball coach passes away, five good friends and former teammates reunite for a Fourth of July holiday weekend.','Boys will be boys. . . some longer than others.','102min','http://image.tmdb.org/t/p/w780/jKtFxygwI6qNoyR7LhPczWCbvTh.jpg'),(746,'The Hangover','Comedy',2,2009,'When three friends finally come to after a raucous night of bachelor-party revelry, they find a baby in the closet and a tiger in the bathroom. But they can\'t seem to locate their best friend, Doug.','Some guys just can\'t handle Vegas.','100min','http://image.tmdb.org/t/p/w780/uEtsf26a9RsRDy85MOIv1xAj44x.jpg'),(747,'Iron Man 3','Action',1,2013,'When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.','Unleash the power behind the armor.','130min','http://image.tmdb.org/t/p/w780/rI8zOWkRQJdlAyQ6WJOSlYK6JxZ.jpg'),(748,'The Incredibles','Action',3,2004,'Bob Parr has given up his superhero days to log in time as an insurance adjuster and raise his three children with his formerly heroic wife in suburbia. But when he receives a mysterious assignment, it\'s time to get back into costume.','No gut, no glory','115min','http://image.tmdb.org/t/p/w780/9eDW2dVhnzPS2HvaRdK2OlAGaLq.jpg'),(749,'Ghostbusters',' Comedy ',3,1984,'After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting \"ghostbusters\"\" who exterminate ghouls, hobgoblins and supernatural pests of all stripes. An ad campaign pays off when a knockout cellist hires the squad to purge her swanky digs of demons that appear to be living in her refrigerator.\"','They ain\'t afraid of no ghost.','107min','http://image.tmdb.org/t/p/w780/g54JU2Bn4EFezsawnI7ccpAzPC7.jpg'),(750,'Iron Man','Action',3,2008,'After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.','Heroes aren\'t born. They\'re built.','126min','http://image.tmdb.org/t/p/w780/rI8zOWkRQJdlAyQ6WJOSlYK6JxZ.jpg'),(751,'The Hangover Part II','Comedy',4,2011,'The Hangover crew heads to Thailand for Stu\'s wedding. After the disaster of a bachelor party in Las Vegas last year, Stu is playing it safe with a mellow pre-wedding brunch. However, nothing goes as planned and Bangkok is the perfect setting for another adventure with the rowdy group.','The Wolfpack Is Back','102min','http://image.tmdb.org/t/p/w780/uEtsf26a9RsRDy85MOIv1xAj44x.jpg'),(752,'The Bourne Identity','Action',5,2002,'Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. However, Bourne realizes that he has the combat and mental skills of a world-class spy.','He was the perfect weapon until he became the target.','119min','http://image.tmdb.org/t/p/w780/vA5xMglyZv7yzDTj1qUTU4OvelV.jpg'),(753,'Skyfall','Action',3,2012,'When Bond\'s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory, the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve - following a trail to the mysterious Silva, whose lethal and hidden motives have yet to reveal themselves.','Think on your sins.','143min','http://image.tmdb.org/t/p/w780/6VcVl48kNKvdXOZfJPdarlUGOsk.jpg'),(754,'Ted','Comedy',3,2012,'John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.','Ted is coming.','106min','http://image.tmdb.org/t/p/w780/dGrNuWhapf8T0WH98xTC4LXgk1G.jpg'),(755,'Trainspotting',' Drama ',5,1996,'Renton, deeply immersed in the Edinburgh drug scene, tries to clean up and get out, despite the allure of the drugs and influence of friends.','Choose life.','93min','http://image.tmdb.org/t/p/w780/rIrAfUd5wjkGoDkecNx1aXjGJLu.jpg'),(756,'We\'re the Millers','Comedy',4,2013,'A veteran pot dealer creates a fake family as part of his plan to move a huge shipment of weed into the U.S. from Mexico.','good photography bad performance','110min','http://image.tmdb.org/t/p/w780/1JXiwPCJXIhubAhEuvyBh5UE6rH.jpg'),(757,'Never Back Down','Drama',1,2008,'Rebellious Jake Tyler is lured into an ultimate underground fight Scene at his new high school, after receiving threats to the safety of his friends and family Jake decides to seek the mentoring of a veteran fighter who trains him for one final no-holds-barred elimination fight with his nemesis and local martial arts champion Ryan McCarthy.','Win or lose... Everyone has their fight.','115min','http://image.tmdb.org/t/p/w780/f069jw6rYHIWfypDjzQvODuGSz8.jpg'),(758,'Dirty Dancing',' Drama ',3,1987,'Expecting the usual tedium that accompanies a summer in the Catskills with her family, 17-year-old Frances \'Baby\' Houseman is surprised to find herself stepping into the shoes of a professional hoofer �������������������������������������','Have the time of your life.','100min','http://image.tmdb.org/t/p/w780/qR6POAKwCL8VwuK8ZjSAdRRFNj9.jpg'),(759,'Harold & Kumar Escape from Guantanamo Bay','Comedy',2,2008,'Having satisfied their urge for White Castle, Harold and Kumar jump on a plane to catch up with Harold\'s love interest, who\'s headed for the Netherlands. But the pair must change their plans when Kumar is accused of being a terrorist. Rob Corddry also stars in this wild comedy sequel that follows the hapless stoners\' misadventures as they try to avoid being captured by the Department of Homeland Security.','This time they\'re running from the joint.','107min','http://image.tmdb.org/t/p/w780/b70mFgsSn2hl3CvC0nRx0SHUEX0.jpg'),(760,'Elite Squad: The Enemy Within','Drama',5,2010,'After a bloody invasion of the BOPE in the High-Security Penitentiary Bangu 1 in Rio de Janeiro to control a rebellion of interns, the Lieutenant-Colonel Roberto Nascimento and the second in command Captain Andre.','The masterminds of the organized crime in Rio','115min','http://image.tmdb.org/t/p/w780/nNUFlXdj8JIV6HnjVS58r0qCvE7.jpg'),(761,'The Devil\'s Rejects','Drama',5,2005,'The sequel to House of 1000 Corpses ','Death walks behind. Hell waits ahead.','107min','http://image.tmdb.org/t/p/w780/osLewbX6FJMy1iUcNHm6hoiNH0j.jpg'),(762,'Diary of a Wimpy Kid','Comedy',4,2010,'Greg Heffley is headed for big things, but first he has to survive the scariest, most humiliating experience of any kid.','It\'s not a diary, it\'s a movie.','92min','http://image.tmdb.org/t/p/w780/hTbw2nLM44eE5m7ZIIXodcoDR1X.jpg'),(763,'The Exorcist',' Drama ',5,1973,'12-year-old Regan MacNeil begins to adapt an explicit new personality as strange events befall the local area of Georgetown. Her mother becomes torn between science and superstition in a desperate bid to save her daughter, and ultimately turns to her last hope: Father Damien Karras, a troubled priest who is struggling with his own faith.','Something almost beyond comprehension is happening to a girl on this street, in this house... and a man has been sent for as a last resort. This man is The Exorcist.','122min','http://image.tmdb.org/t/p/w780/gZnEheMdhKxSZQUEzphCHXldud1.jpg'),(764,'Meet the Fockers','Comedy',5,2004,'Hard-to-crack ex-CIA man, Jack Byrnes and his wife, Dina head for the warmer climes of Florida to meet son-in-law-to-be, Greg Focker\'s parents. Unlike their happily matched offspring, the future in-laws find themselves in a situation of opposites that definitely do not attract.','Misery loves family.','115min','http://image.tmdb.org/t/p/w780/7UWRq79VHc58QXTSn57UsOUKQLZ.jpg'),(765,'Alvin and the Chipmunks','Comedy',2,2007,'A struggling songwriter named Dave Seville finds success when he comes across a trio of singing chipmunks: mischievous leader Alvin, brainy Simon, and chubby, impressionable Theodore.','Get your squeak on!','92min','http://image.tmdb.org/t/p/w780/qI483yHct3PBtIiOH3K3SVNUDq5.jpg'),(766,'Shrek Forever After','Comedy',2,2010,'A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when he\'s duped and sent to a twisted version of Far Far Away.','It ain\'t Ogre... Til it\'s Ogre','93min','http://image.tmdb.org/t/p/w780/gMWrKQjoTIpYjhc8SxZF20EDIES.jpg'),(767,'Rocky Balboa','Drama',2,2006,'When he loses a highly publicized virtual boxing match to ex-champ Rocky Balboa, reigning heavyweight titleholder, Mason Dixon retaliates by challenging Rocky to a nationally televised, 10-round exhibition bout. To the surprise of his son and friends, Rocky agrees to come out of retirement and face an opponent who\'s faster, stronger and thirty years his junior.','It ain\'t over \'til it\'s over.','102min','http://image.tmdb.org/t/p/w780/w4h6gjdWPvmu5R9H6zeGDPo1ZuV.jpg'),(768,'Blue in the Face',' Comedy  ',3,1995,'Auggie runs a small tobacco shop in Brooklyn, New York. The whole neighborhood comes to visit him to buy cigarettes and have some small talk. During the movie Lou Reed tries to explain why he has to have a cut on his health insurance bill if he keeps smoking and Madonna acts as a Singing Telegram.','Welcome to the planet Brooklyn.','83min','http://image.tmdb.org/t/p/w780/r4Ov7P8OADcOxfpuDujoJl2Cqry.jpg'),(769,'Bad Santa','Drama',3,2003,'A miserable conman and his partner pose as Santa and his Little Helper to rob department stores on Christmas Eve. But they run into problems when the conman befriends a troubled kid, and the security boss discovers the plot.','He doesn\'t care if you\'re naughty or nice.','91min','http://image.tmdb.org/t/p/w780/plVMZOMBsHUNNkCQEoY1rW0B5Qb.jpg'),(770,'Elite Squad','Drama',4,2007,'In 1997, before the visit of the pope to Rio de Janeiro, Captain Nascimento from BOPE (Special Police Operations Battalion) is assigned to eliminate the risks of the drug dealers in a dangerous slum nearby where the pope intends to be lodged.','On the streets of Rio only the elite survive','115min','http://image.tmdb.org/t/p/w780/nNUFlXdj8JIV6HnjVS58r0qCvE7.jpg'),(771,'Blue Lagoon: The Awakening','Drama',1,2012,'Two high school students become stranded on a tropical island and must rely on each other for survival. They learn more about themselves and each other while falling in love.','The Awakening','85min','http://image.tmdb.org/t/p/w780/m8LAOuIhlCBr6dWdtVF2C2ioMrc.jpg'),(772,'A Very Harold & Kumar Christmas','Comedy',3,2011,'Six years have elapsed since Guantanamo Bay, leaving Harold and Kumar estranged from one another with very different families, friends and lives. But when Kumar arrives on Harold\'s doorstep during the holiday season with a mysterious package in hand, he inadvertently burns down Harold\'s father-in-law\'s beloved Christmas tree. To fix the problem, Harold and Kumar embark on a mission through New York City to find the perfect Christmas tree, once again stumbling into trouble at every single turn.','Christmas comes prematurely.','108min','http://image.tmdb.org/t/p/w780/b70mFgsSn2hl3CvC0nRx0SHUEX0.jpg'),(773,'Clerks',' Comedy  ',5,1994,'Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.','Just because they serve you doesn\'t mean they like you.','92min','http://image.tmdb.org/t/p/w780/6Fjkbh2DVAvVZa3c1HamblAN5Bg.jpg'),(774,'The Muppets','Comedy',3,2011,'When Kermit the Frog and the Muppets learn that their beloved theater is slated for demolition, a sympathetic human, Gary, and his puppet roommate, Walter, swoop in to help the gang put on a show and raise the $10 million they need to save the day.','They\'re closer than you think.','103min','http://image.tmdb.org/t/p/w780/1AWd3MM90G47mxtD112gRDxSXY9.jpg'),(775,'High School Musical','Comedy',2,2006,'Troy (Zac Efron), the popular captain of the basketball team, and Gabriella (Vanessa Anne Hudgens), the brainy and beautiful member of the academic club, break all the rules of East High society when they secretly audition for the leads in the school\'s musical. As they reach for the stars and follow their dreams, everyone learns about acceptance, teamwork, and being yourself. And it\'s all set to fun tunes and very cool dance moves!','This School Rocks Like No Other!','98min','http://image.tmdb.org/t/p/w780/t1mwGPJi3NkwMeyeUHr9zlQhlTo.jpg'),(776,'Alvin and the Chipmunks: The Squeakquel','Comedy',3,2009,'Pop sensations Alvin, Simon and Theodore end up in the care of Dave Seville\'s twenty-something nephew Toby. The boys must put aside music super stardom to return to school, and are tasked with saving the school\'s music program by winning the $25,000 prize in a battle of the bands. But the Chipmunks unexpectedly meet their match in three singing chipmunks known as The Chipettes - Brittany, Eleanor and Jeanette. Romantic and musical sparks are ignited when the Chipmunks and Chipettes square off.','The Boys are back in town... and they have competition.','88min','http://image.tmdb.org/t/p/w780/qI483yHct3PBtIiOH3K3SVNUDq5.jpg'),(777,'The Girl with the Dragon Tattoo','Drama',1,2009,'Swedish thriller based on Stieg Larsson\'s novel about a male journalist and a young female hacker. In the opening of the movie, Mikael Blomkvist, a middle-aged publisher for the magazine Millennium, loses a libel case brought by corrupt Swedish industrialist Hans-Erik Wennerstre.','Based on the Worldwide Best Seller','152min','http://image.tmdb.org/t/p/w780/9wLsZPhI7ZafO4fh1MhwCjvkclN.jpg'),(778,'Horrible Bosses','Comedy',1,2011,'For Nick, Kurt and Dale, the only thing that would make the daily grind more tolerable would be to grind their intolerable bosses into dust. Quitting is not an option, so, with the benefit of a few-too-many drinks and some dubious advice from a hustling ex-con, the three friends devise a convoluted and seemingly foolproof plan to rid themselves of their respective employers... permanently.','Ever wish your boss was dead?','98min','http://image.tmdb.org/t/p/w780/kGvdIEuzy0rHnbIJ0qmnIjRGSKW.jpg'),(779,'Wall Street: Money Never Sleeps','Drama',2,2010,'As the global economy teeters on the brink of disaster, a young Wall Street trader partners with disgraced former Wall Street corporate raider Gordon Gekko on a two tiered mission: To alert the financial community to the coming doom, and to find out who was responsible for the death of the young trader\'s mentor.','Gordon never gives up.','133min','http://image.tmdb.org/t/p/w780/sEKYBSwZFFppJ5GmEVxsECr7ilR.jpg'),(780,'Marley & Me','Comedy',1,2008,'A newly married couple who, in the process of starting a family, learn many of life\'s important lessons from their trouble-loving retriever, Marley. Packed with plenty of laughs to lighten the load, the film explores the highs and lows of marriage, maturity and confronting one\'s own mortality, as seen through the lens of family life with a dog.','Heel the love.','115min','http://image.tmdb.org/t/p/w780/gRoCEiWVcTsV0HxWIezuhVoDiAa.jpg'),(781,'Nymphomaniac: Vol. II','Drama',4,2013,'The continuation of Joe\'s sexually dictated life delves into the darker aspects of her adult life and what led to her being in Seligman\'s care.','Forget About Love','123min','http://image.tmdb.org/t/p/w780/pUswifNwnQ5beSsqbAj1585ugIa.jpg'),(782,'Grown Ups 2','Comedy',2,2013,'The all-star comedy cast from Grown Ups returns (with some exciting new additions) for more summertime laughs. Lenny (Adam Sandler) has relocated his family back to the small town where he and his friends grew up. This time around, the grown ups are the ones learning lessons from their kids on a day notoriously full of surprises: the last day of school.','Just because they\'re a little older doesn\'t mean they\'ve grown up.','100min','http://image.tmdb.org/t/p/w780/jKtFxygwI6qNoyR7LhPczWCbvTh.jpg'),(783,'Hoodwinked Too! Hood VS. Evil','Comedy',1,2011,'Red Riding Hood is training in the group of Sister Hoods, when she and the Wolf are called to examine the sudden mysterious disappearance of Hansel and Gretel.','Not All Fairy Tales Go By the Book.','86min','http://image.tmdb.org/t/p/w780/sIn465LgZqpxWnNjXSmpygpRnl3.jpg'),(784,'Step Up 3D','Drama',4,2010,'A tight-knit group of New York City street dancers, including Luke and Natalie, team up with NYU freshman Moose, and find themselves pitted against the world\'s best hip hop dancers in a high-stakes showdown that will change their lives forever.','Two Worlds. One Dream.','107min','http://image.tmdb.org/t/p/w780/3jr0rQcsWyfqBlmzE0h0igjJohS.jpg'),(785,'The Woman in Black','Drama',1,2012,'The story follows a young lawyer, Arthur Kipps, who is ordered to travel to a remote village and sort out a recently deceased client','What did they see?','95min','http://image.tmdb.org/t/p/w780/pw8JrqNceLQ82KWZpHg5VghWTqn.jpg'),(786,'Magic Mike','Drama',2,2012,'Mike, an experienced stripper, takes a younger performer called The Kid under his wing and schools him in the arts of partying, picking up women, and making easy money.','Work all day. Work it all night.','110min','http://image.tmdb.org/t/p/w780/pMsWqd89zwqjte70rPIXj52jc0X.jpg'),(787,'The Disappearance of Eleanor Rigby: Her','Drama',1,2014,'Told from the female perspective, the story of a couple trying to reclaim the life and love they once knew and pick up the pieces of a past that may be too far gone.','Two Films. One Love.','100min','http://image.tmdb.org/t/p/w780/3eyH0cwrBdrSCwKF24oOwy8fO7O.jpg'),(788,'The Eye','Drama',5,2008,'Violinist Sydney Wells was accidentally blinded by her sister Helen when she was five years old. She submits to a cornea transplantation, and while recovering from the operation, she realizes that she is seeing dead people.','How can you believe your eyes when they\'re not yours?','98min','http://image.tmdb.org/t/p/w780/rki7UPSFEaUPuitlQ9Iq421p137.jpg'),(789,'Stake Land','Drama',1,2010,'Martin was a normal teenage boy before the country collapsed in an empty pit of economic and political disaster. A vampire epidemic has swept across what is left of the nation\'s abandoned towns and cities, and it\'s up to Mister, a death dealing, rogue vampire hunter, to get Martin safely north to Canada, the continent\'s New Eden.','The Most Dangerous Thing Is To Be Alive.','98min','http://image.tmdb.org/t/p/w780/ejgCF5HlsM3FwxdgzdoEJ7tFN3C.jpg'),(790,'Che: Part Two','Drama',3,2009,'After the Cuban Revolution, Che is at the height of his fame and power. Then he disappears, re-emerging incognito in Bolivia, where he organizes a small group of Cuban comrades and Bolivian recruits to start the great Latin American Revolution. Through this story, we come to understand how Che remains a symbol of idealism and heroism that lives in the hearts of people around the world.','A revolutionary life.','131min','http://image.tmdb.org/t/p/w780/9WEBVDt9wj5sal9LnzWXwNtSEqP.jpg'),(791,'Sympathy for Lady Vengeance','Drama',1,2005,'After a 13-year imprisonment for the kidnap and murder of a 6 year old boy, beautiful Lee Guem-ja starts seeking revenge on the man that was really responsible for the boy\'s death. With the help of fellow inmates and reunited with her daughter, she gets closer and closer to her goal. But will her actions lead to the relief she seeks?','All she wanted was a peaceful life... they didn\'t give it.','115min','http://image.tmdb.org/t/p/w780/t5zZZOvXK8m5z1omMdEEWcL6ywl.jpg'),(792,'Before Sunset','Drama',4,2004,'Nine years ago two strangers met by chance and spent a night in Vienna that ended before sunrise. They are about to meet for the first time since. Now they have one afternoon to find out if they belong together.','What if you had a second chance with the one that got away?','80min','http://image.tmdb.org/t/p/w780/wtNugZq8ZzBYwPIh3VoNUJdkBWG.jpg'),(793,'Dolphin Tale','Drama',4,2011,'A story centered on the friendship between a boy and a dolphin whose tail was lost in a crab trap.','Inspired by the amazing true story of Winter.','113min','http://image.tmdb.org/t/p/w780/hEji18uGq2IwKWs2IpWFw9EwlJp.jpg'),(794,'The Disappearance of Eleanor Rigby: Them','Drama',4,2014,'A New York couple\'s relationship is tested after the loss of their child. This film is the wide-released combination of the original two :him and :her volumes that premiered at the Cannes Film Festival.','Two films. One love.','119min','http://image.tmdb.org/t/p/w780/3eyH0cwrBdrSCwKF24oOwy8fO7O.jpg'),(795,'Monsters','Drama',4,2010,'Six years ago NASA discovered the possibility of alien life within our solar system. A probe was launched to collect samples, but crashed upon re-entry over Central America. Soon after, new life forms began to appear and half of Mexico was quarantined as an infected zone. Today, the American and Mexican military still struggle to contain \"the creatures,\"\" while a journalist agrees to escort a shaken tourist through the infected zone in Mexico to the safety of the U.S. border.\"','After Six Years, They\'re No Longer Aliens. They\'re Residents','94min','http://image.tmdb.org/t/p/w780/2k8KXYTcqxkKpq7lBZFMJ4zjBUF.jpg'),(796,'God\'s Not Dead','Drama',4,2014,'College philosophy professor Mr. Radisson\'s curriculum is challenged by his new student, Josh, who believes God exists.','What do you believe?','113min','http://image.tmdb.org/t/p/w780/ykT8iDLI2kID4zD0KLWzZjBFQVt.jpg'),(797,'Ip Man','Drama',3,2008,'A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun. The film focuses on events surrounding Ip that took place in the city of Foshan between the 1930s to 1940s during the Second Sino-Japanese War. Directed by Wilson Yip, the film stars Donnie Yen in the lead role, and features fight choreography by Sammo Hung.','The celebrated Kung Fu master of Bruce Lee.','108min','http://image.tmdb.org/t/p/w780/1oCPXe4e0VHZTJX4nLkvxzayXK9.jpg'),(798,'The Butterfly Effect 2','Drama',1,2006,'After his girlfriend, Julie and two best friends are killed in a tragic auto accident, Nick struggles to cope with his loss and grief. Suffering from migraine-like seizures, Nick soon discovers that he has the power to change the past via his memories. However, his time-traveling attempts to alter the past and save his one true love have unexpected and dire consequences.','Can you change your past without destroying your future?','95min','http://image.tmdb.org/t/p/w780/7DsbbkQAKSci07Jp4fJVq3QXSEF.jpg'),(799,'Cold Prey','Drama',3,2006,'Jannicke, Morten Tobias, Eirik, Mikael and Ingunn are on a snowboarding vacation in Jotunheimen. They are forced to take shelter in an abandoned hotel when Morten Tobias breaks his leg and their car is too far away for them to reach within nightfall. They quickly discover that the hotel was closed in the seventies due to the disappearance of the managers��������','You\'ll Catch Your Death.','97min','http://image.tmdb.org/t/p/w780/pK3ragjF3xKP6ltmf6FDoWNXaOL.jpg'),(800,'Kidulthood','Drama',5,2006,'A day in the life of a group of troubled 15-year-olds growing up in west London.','Before adulthood comes...','89min','http://image.tmdb.org/t/p/w780/nWby7b0qi20Cs5qfwwdVW56OImJ.jpg'),(801,'Hogfather','Drama',4,2006,'It\'s Hogswatch (equivalent to Christmas) on the Discworld and the Hogfather has gone missing, requiring Death to take his place while his granddaughter Susan endeavors to find out what has happened.','This holiday expect the unexpected','185min','http://image.tmdb.org/t/p/w780/x1xgpkM4CBIQgGEVy6TTyf9KOke.jpg'),(802,'La Notte',' Drama  ',2,1961,'A married couple attend a bourgeois party and wade through the stifling strain that long-term marriage has imposed upon them.','Many nights led to this night, nights of time, nights of fear, nights of love, nights of loneliness, nights of pursuit and conquest, nights without privacy, and this night - a night of truth','115min','http://image.tmdb.org/t/p/w780/5nQqIlvdpgRQrTYG8H1LcwFXCC9.jpg'),(803,'Atlas Shrugged Part II','Drama',3,2012,'The global economy is on the brink of collapse. Brilliant creators, from artists to industrialists, continue to mysteriously disappear. Unemployment has risen to 24%. Gas is now $42 per gallon.  Dagny Taggart, Vice President in Charge of Operations for Taggart Transcontinental, has discovered what may very well be the answer to the mounting energy crisis - found abandoned amongst ruins, a miraculous motor that could seemingly power the World.  But, the motor is dead... there is no one left to decipher its secret... and, someone is watching','Who is John Galt?','112min','http://image.tmdb.org/t/p/w780/bNBqsXH8JSK2zKrYOB217G6IhgE.jpg'),(804,'Race','Drama',4,2008,'Ranvir and Rajiv are half brothers who own a huge stud farm in South Africa. Ranvir is a very shrewd and aggressive man while Rajiv is laid back, and a chronic alcoholic. Sophia, Ranvir\'s personal secretary adores and loves him. Ranvir is unaware of her feelings. Shaina, an Indian ramp model in Durban loves Ranvir but through a twist of fate gets married to his younger brother Rajiv. When she discovers that Rajiv is a chronic alcoholic, her world is shattered. Ranvir too is disturbed as he has sacrificed his love for his younger brother because Rajiv had promised to leave alcohol for good if he marries Shaina. In a weak moment Ranvir and Shaina come very close to each other. When Rajiv starts suspecting, all hell breaks loose. A murder is committed, a contract killing is issued. A sharp tongued detective R.D., getting wise on the proceedings, starts an intriguing investigation with his brainless bimbo assistant Mini','Two Brothers... One Plays to Win... One Plays to Defeat','161min','http://image.tmdb.org/t/p/w780/6IGJVSafLNIVFUCXnWcrc5NixZQ.jpg'),(805,'Atlas Shrugged Part III: Who is John Galt?','Drama',3,2014,'Approaching collapse, the nation\'s economy is quickly eroding. As crime and fear take over the countryside, the government continues to exert its brutal force against the nation\'s most productive who are mysteriously vanishing - leaving behind a wake of despair. One man has the answer. One woman stands in his way. Some will stop at nothing to control him. Others will stop at nothing to save him. He swore by his life. They swore to find him.','Who is John Galt?','99min','http://image.tmdb.org/t/p/w780/bNBqsXH8JSK2zKrYOB217G6IhgE.jpg'),(806,'The Girl Who Played with Fire','Drama',3,2009,'Mikael Blomkvist, publisher of Millennium magazine, has made his living exposing the crooked and corrupt practices of establishment Swedish figures. So when a young journalist approaches him with a meticulously researched thesis about sex trafficking in Sweden and those in high office who abuse underage girls, Blomkvist immediately throws himself into the investigation.','Fight Fire with Fire','129min','http://image.tmdb.org/t/p/w780/9wLsZPhI7ZafO4fh1MhwCjvkclN.jpg'),(807,'The Best Exotic Marigold Hotel','Drama',1,2011,'British retirees travel to India to take up residence in what they believe is a newly restored hotel. Less luxurious than its advertisements, the Marigold Hotel nevertheless slowly begins to charm in unexpected ways as the residents find new purpose in their old age.','Share the journey. Share the laughter.','124min','http://image.tmdb.org/t/p/w780/6rJSC6vA9tfEnAh4RN9ne6cInQL.jpg'),(808,'Atlas Shrugged Part I','Drama',2,2011,'A powerful railroad executive, Dagny Taggart, struggles to keep her business alive while society is crumbling around her. Based on the 1957 novel by Ayn Rand.','Who is John Galt?','97min','http://image.tmdb.org/t/p/w780/bNBqsXH8JSK2zKrYOB217G6IhgE.jpg'),(809,'Java of the Rings','Comedy',5,2022,'The struggle of a university project group against a really had programming language.','I have never laughed more in my life.','2min','QR CODE TO BE INSERTED'),(810,'Guardians of the Galaxy','Action',4,2014,'Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.','All heroes start somewhere.','121min','http://image.tmdb.org/t/p/w780/jdyyjulTBU8YUYAUvQFj6U1g2Pj.jpg'),(811,'The Godfather',' Drama ',3,1972,'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.','An offer you can\'t refuse.','175min','http://image.tmdb.org/t/p/w780/3WZTxpgscsmoUk81TuECXdFOD0R.jpg');
